<!DOCTYPE html>
<html><head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Breast Cancer End Screen</title>
  <style>
    :root {
      --clr-white: #fff;
      --clr-text-color: #fe4866;
      --clr-text-color-alpha: #fe48664c;
      --clr-bg-color: #ffcece;
    }

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    html,
    body {
      height: 100%;
    }

    body {
      font-family: sans-serif;
    }

    main {
      width: 100%;
      min-height: 100vh;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      background-repeat: no-repeat;
      background-size: cover;
      background-position: center;
    }

    .content-wrapper {
      height: 90vh;
      width: 100%;
      display: flex;
      flex-direction: column;
      justify-content: space-around;
      align-items: center;
    }

    #lottie{
          /* background-color:#ffffff; */
          width:100%;
          height:40%;
          display:block;
          overflow: hidden;
          transform: translate3d(0,0,0);
          text-align: center;
          opacity: 1;
      }

    .text-container {
      color: var(--clr-text-color);
      width: 80%;
      text-align: center;
    }

    .text-container .title {
      font-size: 2rem;
      font-weight: 700;
      margin-bottom: 1.5rem;
    }

    .text-container .description p {
      margin-bottom: 1rem;
    }

    .button-group-container {
      width: 80%;
      height: 9rem;
      display: flex;
      flex-direction: column;
      align-items: center;
      gap: 1rem;
    }

    .button-group-container p {
      color: var(--clr-text-color);
    }

    .button-group-container button {
      width: 80%;
      height: 3rem;
      border-radius: 50px;
      background: none;
      color: rgb(255, 255, 255);
      font-weight: 600;
      font-size: medium;
      border: transparent;
      cursor: pointer;
      outline: none;
    }

    .button-group-container button:disabled {
      background: lightgrey;
      color: darkgrey;
      cursor: default;
      border: none;
    }

    .button-group-container .restart-button {
      color: var(--clr-text-color);
      background-color: var(--clr-white);
      border: 2px solid var(--clr-bg-color);
    }

     .button-group-container button:hover {
      color: var(--clr-white);
      background-color: var(--clr-text-color);
    }

    .button-group-container .take-quiz-button {
      color: var(--clr-text-color);
      background-color: var(--clr-bg-color);
    }

    @keyframes fadeIn {
      from {
        opacity: 0;
      }
      to {
        opacity: 1;
      }
    }

    @-webkit-keyframes fadeIn {
      from {
        opacity: 0;
      }
      to {
        opacity: 1;
      }
    }
  </style>
</head>
